import react, {Component} from "react";

export default class Comments extends Component {
    render() {
        return (
            <div className="comments">
                <p>Comments:</p>
                <div className="comment">
                    <p>Comment 1</p>
                </div>
                <div className="comment">
                    <p>Comment 2</p>
                </div>
                <div className="comment">
                    <p>Comment 3</p>
                </div>
            </div>
        )
    }
}
